                   {items.map(item => { 
        return (
      
                     <tr>  
                       <td>{item.model}</td>
                       <td>{item.brand}</td>
                       <td>{item.year}</td>
                       <td>{item.transmission}</td>
                       <td>{item.address}</td>
                       
                       <td>{item.type}</td>
                       <td>{item.price}</td>
                       
                       <td>{item.description}</td>
                    
                     </tr>
                   );
                 })}
      
                   </tbody>
            </Table>
      
          );
    };
    var items = JSON.parse(localStorage.getItem("cars"));
   getCars();
   printCars();
    

    return (
        <div>
         
        <Table striped>
           <thead>
               <tr>
                   <th>Model</th>
                        <th>Brand</th>
                        <th>Year</th>
                        <th>Transmission</th>
                        <th>Address</th>
                        <th>Type</th>
                        <th>Price</th>
                        <th>Description</th>
                </tr>
            </thead>
            <tbody>
        
                { items.map(item => { 
                    return (

                            <tr>  
                                 <td>{item.model}</td>
                                 <td>{item.brand}</td>
                                  <td>{item.year}</td>
                                    <td>{item.transmission}</td>
                                    <td>{item.address}</td>
                                    <td>{item.type}</td>
                                    <td>{item.price}</td>
                                    <td>{item.description}</td>
                            </tr>
                        );
                })}

            </tbody>
        </Table>
        
        </div>
    );
};
